import React from 'react';

function LeftCard(props) {
    return (
        <div className="col col-md-6 col-sm-12 coloum">
            <div class="card">
                <img class="card-img-top" src={props.urlToImage} alt="Card image cap" />
                <div class="card-body">
    <h5 class="card-title">{props.title}</h5>
    <p class="card-text">{props.content}</p>
                </div>
            </div>
        </div>
    )
}
export default LeftCard;
